import React from 'react';
import { Button, Container, Grid, makeStyles } from '@mui/material';
import MaterialTheme from '../';
import NavigationBar from '../components/navBar';
import BlogBox from './blog';

const useStyles = makeStyles((theme) => ({
	backgroundContainer: {
		backgroundColor: theme.palette.background.default,
		position: 'absolute',
		...theme.spacing(12, 15, 15, 15), // Use Material-UI spacing for margin values
		bottom: 0,
	},
}));

const Screen = () => {
	const classes = useStyles();

	return (
		<MaterialTheme>
			<Container>
				<Grid container justifyContent="flex-end" alignItems="flex-start" spacing={2}>
					<Grid item xs={12}>
						<Button style={{ textDecoration: 'underline', color: 'black' }} className='navButton login-link'>
              Log-in / Registrarse
						</Button>
					</Grid>
					<Grid item xs={12} className={classes.backgroundContainer}>
						<NavigationBar />
						<BlogBox title="Example Title" likes={10} userLink="example.com" username="example_user" />
						{/* Add more BlogBox components as needed */}
					</Grid>
				</Grid>
			</Container>
		</MaterialTheme>
	);
};

export default Screen;
